css:
@-moz-document domain(www.roblox.com)
  {
@keyframes rainbow
  {
    0% {background-color: #FF0080;
    border-color: #FF0080;
  }

  14%
  {
    background-color: #FF48A5;
    border-color: #FF48A5;
  }

  28%
  {
    background-color: #FF78BD;
    border-color: #FF78BD;
  }

  42%
  {
    background-color: #FFAED7;
    border-color: #FFAED7;
  }

  56%
  {
    background-color: #FFCAE6;
    border-color: #FFCAE6;
  }

  80%
  {
    background-color: #FFAED7;
    border-color: #FFAED7;
  }

  94%
  {
    background-color: #FF78BD;
    border-color: #FF78BD;
  }

  100%
  {
    background-color: #FF48A5;
    border-color: #FF48A5;
  }
}

.btn-common-play-game-lg
{
  animation: rainbow 10s infinite;
}
